import React from "react";

function AboutMe() {
	return (
		<section>
			<h1>Hey, I'm Naail.</h1>
			<p>
				I'm an MIT-trained computer scientist interested in game theory, web
				development, and AI.
			</p>
			<p>I'm an avid poker player and ex-president of the MIT Poker Club.</p>
			<p>
				In the past, I've engineered trading systems at Two Sigma, developed
				prediction models for Reddit activity at SIG, and built an options
				trading platform at IMC Trading.
			</p>
			<p>
				Now, I work on trading systems at Novig where I lead development of our
				in-house market making desk..
			</p>
		</section>
	);
}

export default AboutMe;
